    "2016-07-27T22:18:55.807412",nt"name": "final-environmental-assessment-opening-waterfowl-hunting-on-5500-acres-of-former-commercia",nt"isopen":
    false,nt"url": null,nt"notes": "This EA for opening waterfowl hunting on
    salt ponds recently acquired by the Don Edwards San Francisco Bay National Wildlife
    Refuge proposes three alternatives.  Under the preferred alternative, a selected
    number of ponds would be open to waterfowl hunting. Hunting would be allowed for
    three days each week following regulations, season and bag limits set by the California
    Department of Fish and Game under the Federal framework for hunting in the Pacific
    Flyway.  A small, temporary decline in refuge waterfowl is expected under this alternative,
    but there would be no measurable effect on Pacific Flyway waterfowl populations.
     The proposed Hunt Plan Amendment would have no effect on the threatened and endangered
    species found on the refuge except the California Brown Pelican which was classified
    as u201cmay affect, but not likely to adversely affectu201d.",nt"license_title":
